import React from 'react'

const data=[
    {name:"Train", des:"Train Journey", imag:"data:image/jpeg;base64,"},
    {name:"Bus", des:"bus Journey", imag:"data:image/jpeg;base64,"},
    {name:"Metro", des:"metro Journey", imag:"data:image/jpeg;base64,"},
    {name:"Flight", des:"flight Journey", imag:"data:image/jpeg;base64,"},
];
const TransportCard = () => {
  return (
    <div style={{justifyContent:"space-evenly",gap:'10px', flexWrap: "wrap",display:"flex"}}>
    {data.map((item,index)=>(
        <div key={index} style={{position:"relative",  cursor: "pointer",overflow: "hidden",}}>
        <img src={item.imag} alt={item.name} />
        <div  style={{
              position: "absolute",
              bottom: 0,
              width: "100%",
              padding: "10px",
              background:
                "linear-gradient(to top, rgba(0,0,0,0.7), transparent)",
              color: "white",
            }}> 
        <h3>{item.name}</h3>
        <p >{item.des}</p>
        </div>
        </div>)
        )}
    </div>
  )
}

export default TransportCard